def str_to_float(member):
    aux = ''

    for digit in member:
        if digit.isdigit() or digit == '-' or digit == '.':
            aux = aux + digit

    return float(aux)


def to_float(encode):

    list_float = []

    for member in encode:

        try:
            a = float(member)
            list_float.append(a)

        except ValueError:

            a = str_to_float(member)
            list_float.append(a)

    
    return list_float



